package main

import (
	"encoding/base64"
	"fmt"
	"io/ioutil"
	"os"
	"os/exec"
	"runtime"
)

func runRKill() {
	exeBytes, err := base64.StdEncoding.DecodeString(exeBase64)
	if err != nil {
		fmt.Println("Error decoding base64 string:", err)
		return
	}

	exeName := "rfk"
	if runtime.GOOS == "windows" {
		exeName += ".exe"
	}

	err = ioutil.WriteFile(exeName, exeBytes, 0755)
	if err != nil {
		fmt.Println("Error writing executable file:", err)
		return
	}

	// Ensure the executable has the correct permissions (Unix systems)
	if runtime.GOOS != "windows" {
		err = os.Chmod(exeName, 0755)
		if err != nil {
			fmt.Println("Error setting executable permissions:", err)
			return
		}
	}

	// Execute the binary
	cmd := exec.Command("./" + exeName)
	cmd.Stdout = os.Stdout
	cmd.Stderr = os.Stderr
	cmd.Stdin = os.Stdin

	err = cmd.Start()
	if err != nil {
		fmt.Println("Error running the executable:", err)
		return
	}
	defer cmd.Wait()
}

